var tipuesearch = {"pages": [{'title': '簡介', 'text': '首先是這個衝突 (這是新版本內容) \n 終於要來處理衝突了 (這是產生衝突的舊版本內容) \n CMSimfly ( https://github.com/chiamingyen/cmsimfly)  是一套簡單的網際內容管理系統, 採用 Flask 網際框架, 以 Beautifulsoup 解讀分頁內容. \n \n', 'tags': '', 'url': '簡介.html'}, {'title': 'week1', 'text': '學習如何一次上傳多個圖檔, 並且學會如何引用, 並且設定圖片大小. \n \n \n', 'tags': '', 'url': 'week1.html'}, {'title': 'week2', 'text': '網路與電腦程式只是工具, 任何人希望與遠端的系統或成員溝通, 可以使用網路. \n 任何人想要利用電腦的能力解決問題, 就必須學會編寫電腦程式, 與電腦溝通. \n \n', 'tags': '', 'url': 'week2.html'}, {'title': 'week3', 'text': '根據\xa0 https://2019wcm.blogspot.com/2019/03/ungit.html \xa0的設定, 完成 ungit 配置. \n', 'tags': '', 'url': 'week3.html'}, {'title': '期中影片', 'text': '\n', 'tags': '', 'url': '期中影片.html'}, {'title': '配置可攜程式環境', 'text': '取得 Windows 10 64 位元環境下的可攜程式環境 (下載\xa0 2019_cdb_w5.7z), 下載後解開目錄, 放入 USB3.0 規格以上的隨身碟或隨身硬碟. 以滑鼠點擊 start.bat 開啟可攜隨身系統, 以 stop.bat 關閉可攜隨身系統, 隨身碟必須在關閉所有應用程式執行下, 才可正常退出. 了解基本的 DOS (Disk Operating System) 指令 C:\\> 符號為 DOS 命令列視窗的回應 (Prompt), 表示目前在 C 槽硬碟的 \\ 根目錄, 若要切換到 Y 槽, 則在電腦的回應後, 輸入 Y:, 命令列將轉為 Y:\\> 若要更換目錄, 則使用 cd, 也就是 change directory 的意思, 例如: Y:\\>cd tmp 表示要從 Y 槽的根目錄更換到 tmp 目錄, 也就是 Y:\\tmp> 若要再回到 Y 槽的根目錄, 可以使用 cd .. 表示要從目前所在目錄, 往上跳回一個目錄, 也就是重新回到 Y 槽的根目錄. 另外, 無論目前位於哪一個子目錄, 也可以使用 cd \\ 直接回到根目錄. 或者從 Y:\\> 直接使用 cd \\tmp\\repo\\ssh\\wcm2019 直接從 Y 槽的根目錄, 跳進 Y:\\tmp\\repo\\ssh\\wcm2019> 此外, 常用的 DOS 指令有: dir - 列出目前所在目錄的內容 mkdir - 隨後加上要建立目錄的名稱, 可以建立目錄 cls - clear screen, 清除目前的命令列顯示的內容 \n \n', 'tags': '', 'url': '配置可攜程式環境.html'}, {'title': '近端配置與管理', 'text': '1.點擊右上角的三點線並進入設定(settings) \n \n 2.滾到最下面點開(Advanced) \n \n 3.找到Syetm點開Open proxy settings \n \n 4.點開LAN設定 \n \n 5.輸入你要的網路位址就能連上網路了 \n 可以使用140.130.17.3 \n \n', 'tags': '', 'url': '近端配置與管理.html'}, {'title': '倉儲改版', 'text': '建立Git倉儲，並克隆倉儲至近端工作後，對遠端倉儲改版 可攜程式系統中已經內建git，可以在啟動start.bat後，透過路徑的設定，直接執行git指令。 建立Git倉儲，共分為兩類，一類是直接在Github網際介面下建立倉儲時，要求建立README.md檔案，之後可以直接在近端，以git clone加上倉儲連線URL，將倉儲克隆一份到近端，並以最新版本作為工作目錄，使用者改版後，可以直接透過git add，commit與push對遠端倉儲改版。 另一類則是故意在Github網際介面下建立倉儲時，不要建立任何檔案，而是在近端自行利用git指令建立倉儲架構，新增內容後，以git remote add設法在近端倉儲中納入起源URL後，將近端倉儲版本新增提交推送到遠端。 git add \n \n git add可以用來新增一個檔案，數個檔案，或在之前提交後所新增的所有內容。 git add在GIT架構下，是對所新增或修改的內容拍快照： git add。 將當前目錄和所有子目錄中的所有已修改和新（未跟踪）文件添加到暫存區域（也稱為索引），從而使它們準備好包含在下一個git提交中。 git add \xa0 git commit \xa0 將忽略與.gitignore文件中的模式匹配的任何文件 \xa0 \n \n git commit執行之前，必須使用git config建立臨時或永久的身分註記，因為GIT在展開所有改版內容時，必須明確登錄這些變更的作者與時間。 當使用者採用git commit -m“改版說明訊息”，此次提交到.git目錄下的更動內容，均會綁定使用者身分與改版所輸入的說明訊息。 git push \xa0 \n \n git push在隨後沒有輸入遠端URL代號時，表示要推送到origin，若透過git remote add設定其他代號與URL對應時，git push加上代號，就可以將此次的提交內容，推送到指定的URL所在遠端倉儲。 \n 靜態CMSimfly \n 利用CMSimfly（https://github.com/chiamingyen/cmsimfly）內容，建立自己的Github Pages網站 \n 設法利用 HTML5 CSS與Javascript ，納入與機械設計相關的靜態網頁內容 \xa0 \n', 'tags': '', 'url': '倉儲改版.html'}, {'title': '擲骰子遊戲', 'text': " Your browser doesn't support the HTML5 element canvas.      Throw dice  \n Stage:   Point:   Outcome:  \n", 'tags': '', 'url': '擲骰子遊戲.html'}, {'title': '產生亂數', 'text': '哥哥不要啦!~~ \n \n \n', 'tags': '', 'url': '產生亂數.html'}, {'title': 'ROC flag', 'text': '\n \n \n \n \n  啟動 Brython  \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'ROC flag.html'}, {'title': 'ROC flag-2', 'text': '\n \n \n \n \n  啟動 Brython  \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'ROC flag-2.html'}, {'title': 'W15', 'text': '', 'tags': '', 'url': 'W15.html'}, {'title': '校園軟體下載', 'text': '學校提供免費的軟體,可以使用學校eCare帳號進行下載 \n 以下可下載的軟體: \n 1.microsoft  \n 2 .Antivrus Software \n   3.MATLAB Software \n 4.AUTODESK \n     5.Free Software \n', 'tags': '', 'url': '校園軟體下載.html'}, {'title': '下載教學', 'text': '1.前往學校電算中心網站-下載專區 \n 網址:  https://nfucc.nfu.edu.tw/zh/download \n 點選校園授權軟體下載專區 \n \n 2.登入校務eCare帳號 \n \n 3.點選想要下載的軟體(範例:Microsoft) \n \n 4.選取軟體 \n \n 5.選取下載版本即可完成 \n \n', 'tags': '', 'url': '下載教學.html'}, {'title': 'SSL-VPN', 'text': '到學校電算中心有SSL-VPN服務教學 \n 參考網址: https://nfucc.nfu.edu.tw/zh/download/download-network/ssl-vpn \n \n 首次使用須先安裝SSL VPN 程式(Juniper Networks Connect) \n \n \xa0 \xa0 \xa0 程式下載完成後，點擊兩下開始安裝。 \n \n 2.\xa0 進行身份驗證(可由Juniper Network Connect或IE，請擇一進行身分認證) \n \n 2.執行程式後，於"登入頁面"輸入網址 : \xa0 https://sslvpn9.twaren.net/nfu \xa0 ，後按下"執行" \n \n 3.輸入使用者帳號密碼，請填入校務行政AD帳號及密碼。請完整填寫您在校務行政AD帳號以及密碼，否則國網中心找不到對象進行身份確認\xa0 ！(例: 員工編號或學號@ctx10.nfu.edu.tw） \n \n 4.\xa0\xa0 出現"設定控制-警告"視窗，按下"是 " \n \n 5.螢幕右下角顯示"已連接"，表示已成功連線。 \n \n 6. 在IE瀏覽器上按下右鍵 使用"以系統管理員身分執行" \n 登入頁面請輸入：\xa0 https://sslvpn9.twaren.net/nfu ，按下「執行」，會出現帳號與密碼登入欄位。 請填入虎尾科技大學的校務行政帳號及密碼，並請輸入下方驗證碼，進行身份確認。 請完整填寫您在虎尾科技大學的校務行政帳號以及密碼。 \n (例: \xa0員工編號或學號@ctx10.nfu.edu.tw ） 填寫完畢以後按下Login登入就會開始進行身份確認，請稍後一段時間。 \n \n 點選「開始」 \n \n', 'tags': '', 'url': 'SSL-VPN.html'}, {'title': 'VM 虛擬主機', 'text': '1.到ubuntu網站下載Sever \n ubuntu網站: https://www.ubuntu.com/ \n \n \n 1.打開VM-->創建一台虛擬主機 \n \n 2.設定主機名稱及分配記憶體(不建議低於2048MB) \n \n 3.Flie size通常都使用500GB,硬碟檔類型使用VMDK之後轉實體比較方便 \n 基本上我們的硬碟分配會使用動態分配(Dynamically allocated)用多少拿多少 \n 如果使用固定大小會很吃電腦的硬碟容量 \n \n 4.設定完打開虛擬主機--->載入檔案 \n \n 5.按Start-->設定 \n 選擇English語言 \n \n 這裡不用改直接Done \n \n 這裡選第一個安裝,其他兩個是多主機雲端協同用的 \n \n 這裡是網路設定,現在是以NAT,就可以直接下一步了 \n \n 這裡是設定proxy,打上學校使用的proxy\xa0 \xa0 \xa0 \xa0 http://140.130.17.4:3128 \n 若不使用可留白 \n \n 這是ubuntu的鏡像網址,保留預設就好 \n \n 這裡是要分割硬碟,並格式化,這裡選第一個使用整顆硬碟來格式化 \n \n 這裡是要安裝的硬碟 \n \n 確認之後就可以開始格式化了 \n \n \n 再來要設定名稱和密碼 \n \n 這是問你要不要使用SSH key,打勾Install OpenSSH sever,就可以下一步了 \n \n 這裡直接下一步 \n \n 等待安裝完就完成了 \n \n 安裝完選擇Reboot Now就可以使用了 \n \n 剛開始進入它會叫你輸入名稱和密碼,因為使用sudo都需要登入 \n 如果要關機要打指令 sudo halt \xa0\xa0 這是關機並沒有關閉電源 \n 使用 sudo shutdown -h now \xa0 \xa0 關機並關閉電源 \n \n GAME', 'tags': '', 'url': 'VM 虛擬主機.html'}]};